    <div className="App">
      <header className='Header'>Ohm's Law Calculator</header>
      <div className='Parent'>
        <Box m={10}>

            <TextField className="v" id="filled-basic" label="Volts" variant="filled" onChange={readValue}/>
            <TextField id="filled-basic" label="Ampere" variant="filled" />
            <TextField id="filled-basic" label="Ohms" variant="filled" />
            <TextField id="filled-basic" label="Watts" variant="filled" />

        </Box>


        <div className='Buttons'>
          <Button variant="contained">Calculate</Button>
        </div>
      </div>

    </div>
  );

